import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import OfferCardItem from './OfferCardItem'
import './Cards.css'

function OfferCards() {
    const [offerList, setOfferList] = useState([]);

    useEffect(() => {
        Axios.get('http://localhost:3001/api/getOffer').then((response) => {
            setOfferList(response.data);
        });
    }, []);

    return (
        <div className="cards">
            <h1>OfferCards.js Line 6</h1>

            <div className="cards__container">
                <div className="cards__wrapper">
                    <ul className="cards__items">

                    {offerList.map((val) => {
                        return (
                            <>
                                <OfferCardItem
                                    src={val.img_src}
                                    alt={val.img_alt}
                                    path={val.tyre_path}
                                    name={val.name}
                                    code={val.idoffer}
                                    data={val.data}
                                    price={val.price}
                                />
                            </>
                        );
                    })}
                        <OfferCardItem
                            src="../images/tire-1.jpg"
                            alt="Cards.js Line 15"
                            path="/Cards.jsLine18"
                            name="Bridgestone Blizzak LM005"
                            code="1"
                            data="Giulia zimske: Jedan od najboljih načina za zadržavanje prianjanja u zimskim uvjetima odabir je gume sa žljebovima koji su dizajnirani za zimske uvjete. Žljebovi na gumi Blizzak LM005 dublji su i postavljeni u cik-cak uzorku radi odvodnje vode, bljuzge i snijega s površine gume, kako bi se zadržalo dodatno prianjanje na snježnim i mokrim cestama."
                            price="1000,00"
                        />

                        <OfferCardItem
                            src="../images/tire-2.jpg"
                            alt="Cards.js Line 23"
                            path="/Cards.jsLine26"
                            name="Toyo Proxes"
                            code="2"
                            data="156"
                            price="2000,00"
                        />

                        <OfferCardItem
                            src="../images/tire-3.jpg"
                            alt="Cards.js Line 23"
                            path="/Cards.jsLine26"
                            name="Imperial"
                            code="3"
                            data="MiTo zimske"
                            price="3000,00"
                        />
                    </ul>

                    <ul className="cards__items">
                        <OfferCardItem
                            src="../images/tire-4.jpg"
                            alt="Cards.js Line 23"
                            path="/Cards.jsLine26"
                            name="GoodYear Eagle F1"
                            code="4"
                            data="Giulia"
                            price="4444,00"
                        />

                        <OfferCardItem
                            src="../images/tire-5.jpg"
                            alt="Cards.js Line 23"
                            path="/Cards.jsLine26"
                            name="Uniroyal RainSport 3"
                            code="5"
                            data="MiTo"
                            price="5555,00"
                        />
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default OfferCards
